import React, { useState } from 'react';
import { useHistory } from "react-router-dom";
import logo_everis from '../Static/Img/images/logo-everis.png';
const axios = require('axios');

export const NavbarComponent = () => {
    let history = useHistory();
    return (
        <>
            <nav class="navbar is-transparent" role="navigation" aria-label="main navigation">
                <div class="navbar-brand">
                    <div class="navbar-item">
                    <figure class="image is-48x48"> 
                         <img alt="" src={logo_everis} />
                    </figure>
                        <h3>Business Development</h3>
                    </div>
                </div>

                <div class="navbar-end">
                    <div class="navbar-item">
                        <div class="buttons">
                            <button class="button is-black" onClick={() =>

                                axios.get(`${process.env.REACT_APP_API_ROOT_URL}/oauth/revoke-token/${sessionStorage.getItem('username')}`, {
                                    headers: {
                                        'Content-Type': 'application/json',
                                        'Authorization': 'Bearer ' + sessionStorage.getItem('user_token')
                                    }
                                }
                                )
                                    .then(function (response) {
                                        // handle success

                                    })
                                    .catch(function (error) {
                                        // handle error

                                    })
                                    .finally(function () {
                                        // always executed
                                        sessionStorage.removeItem('user_token');
                                        history.push('/')
                                    })

                            }>
                                Logout
                            </button>
                        </div>
                    </div>
                </div>
            </nav >
            <small>Welcome {sessionStorage.getItem('username').toUpperCase()}!!</small>
            <hr />

        </>
    );
}

export default NavbarComponent;
